  // Kode sumber skrip iklan Google AdSense
  var adsenseScript = `
    // Mulai iklan Google AdSense
    (adsbygoogle = window.adsbygoogle || []).push({});
    // Selesai iklan Google AdSense
  `;

  // Fungsi untuk mengeksekusi skrip iklan Google AdSense
  function executeAdsenseScript() {
    var scriptElement = document.createElement('script');
    scriptElement.innerHTML = adsenseScript;
    document.head.appendChild(scriptElement);
  }

  // Fungsi yang dipanggil ketika skrip berhasil dimuat
  function adsLoaded() {
    console.log("INFO: Ads are loaded!");
  }

  // Fungsi yang dipanggil ketika terjadi kesalahan saat memuat skrip
  function adsNotLoaded() {
    console.warn("INFO: Looks like Ads are blocked or failed to load!");
    // Lakukan penanganan jika iklan gagal dimuat
  }

  // Memuat skrip iklan Google AdSense
  var adsScriptElement = document.createElement('script');
  adsScriptElement.onload = adsLoaded; // Panggil fungsi adsLoaded jika skrip berhasil dimuat
